              "5fc743c3-6b31-4a40-bd05-24acfb4ca9ba": {
                  "text": "<p>The Millboard London Showroom displays our leading-edge range of decking and hosts a calendar of informative CPD training sessions, architect-focused events and design presentations. The space also functions as a showcase, providing ideas for how people can \u2018Live Life Outside\u2019 \u2013 Millboard\u2019s motto.<\/p><p>&nbsp;<\/p><p>The Showroom is in Clerkenwell, an area with a rich design and architecture heritage. The visitors to our Showroom provide us with a constant source of inspiration and keep us closer to the beating heart of British innovation. Find us at 63 Goswell Road, EC1V 7EN. We are open 8 am - 3:30 pm, Monday - Friday.<br>&nbsp;<\/p>",
                  "textFormat": "cohesion"
              },
