              "41589954-e3d2-499a-97ad-bcab333498fe": {
                  "textFormat": "cohesion",
                  "text": "<h3>What we offer<\/h3><p>Since opening our facility, we\u2019ve hosted a wide range of design-focused activities and learning sessions. From providing our own RIBA-certified CPD, to hosting evening networking meetings, Millboard is committed to providing designers and architects with quality events. We also play an active part in the annual architect Clerkenwell Design Week.<\/p>"
              },
