              "31cc8cda-8925-402a-b1bc-91a89a403ae4": "media.text_and_image_card_4_3",
              "41589954-e3d2-499a-97ad-bcab333498fe": {
                  "textFormat": "cohesion",
                  "text": "<h3>Why Clerkenwell?<\/h3><p>Millboard chose Clerkenwell to create a two-way conversation with design professionals. Nestled amongst the practices of world-renowned architects, the Showroom presents Millboard\u2019s latest collections and is staffed with knowledgeable and experienced members of our team. To speak to us, call <a href=\"020 3978 8800\">020 3978 8800<\/a> or email <a href=\"mailto:clerkenwell@millboard.co.uk\">clerkenwell@millboard.co.uk<\/a><\/p>"
              },
